public int parseInto(DateTimeParserBucket bucket, String text, int position) {
if (position >= text.length()) {
return ~position;
}

char a = text.charAt(position);
char b = iValue;

if (a != b) {
a = Character.toUpperCase(a);
b = Character.toUpperCase(b);
if (a != b) {
a = Character.toLowerCase(a);
b = Character.toLowerCase(b);
if (a != b) {
return ~position;
}
}
}

return position + 1;
}

public void saveField(DateTimeFieldType fieldType, int value) {
saveField(new SavedField(fieldType.getField(iChrono), value));
}

private void saveField(SavedField field) {
SavedField[] savedFields = iSavedFields;
int savedFieldsCount = iSavedFieldsCount;

if (savedFieldsCount == savedFields.length || iSavedFieldsShared) {
// Expand capacity or merely copy if saved fields are shared.
SavedField[] newArray = new SavedField
[savedFieldsCount == savedFields.length ? savedFieldsCount * 2 : savedFields.length];
System.arraycopy(savedFields, 0, newArray, 0, savedFieldsCount);
iSavedFields = savedFields = newArray;
iSavedFieldsShared = false;
}

iSavedState = null;
savedFields[savedFieldsCount] = field;
iSavedFieldsCount = savedFieldsCount + 1;
}

SavedField(DateTimeField field, int value) {
iField = field;
iValue = value;
iText = null;
iLocale = null;
}

public int parseInto(DateTimeParserBucket bucket, String text, int position) {
int limit = Math.min(iMaxParsedDigits, text.length() - position);

boolean negative = false;
int length = 0;
while (length < limit) {
char c = text.charAt(position + length);
if (length == 0 && (c == '-' || c == '+') && iSigned) {
negative = c == '-';

// Next character must be a digit.
if (length + 1 >= limit ||
(c = text.charAt(position + length + 1)) < '0' || c > '9')
{
break;
}

if (negative) {
length++;
} else {
// Skip the '+' for parseInt to succeed.
position++;
}
// Expand the limit to disregard the sign character.
limit = Math.min(limit + 1, text.length() - position);
continue;
}
if (c < '0' || c > '9') {
break;
}
length++;
}

if (length == 0) {
return ~position;
}

int value;
if (length >= 9) {
// Since value may exceed integer limits, use stock parser
// which checks for this.
value = Integer.parseInt(text.substring(position, position += length));
} else {
int i = position;
if (negative) {
i++;
}
try {
value = text.charAt(i++) - '0';
} catch (StringIndexOutOfBoundsException e) {
return ~position;
}
position += length;
while (i < position) {
value = ((value << 3) + (value << 1)) + text.charAt(i++) - '0';
}
if (negative) {
value = -value;
}
}

bucket.saveField(iFieldType, value);
return position;
}

public int parseInto(DateTimeParserBucket bucket, String text, int position) {
DateTimeParser[] elements = iParsers;
if (elements == null) {
throw new UnsupportedOperationException();
}

int len = elements.length;
for (int i=0; i<len && position >= 0; i++) {
position = elements[i].parseInto(bucket, text, position);
}
return position;
}

